$("#ss-modal-hire-now-notify-buttons").on("click","#ss-modal-hire-now-notify-decline",function(){var a=$(this).parent()[0].getAttribute("data-ss-request-id");$.ssModal({action:"close"});$.ajax({url:"/ajax/user/hire_now_decline",type:"POST",data:{hnr_id:a}}).done(function(a){})});socket.on("hire_now_response",function(a){"approve"==a.response?window.location.href="/session/start":$.ssModal({action:"close"})});
